import React, { Component } from "react";
import { Link } from "react-router-dom";
import Fab from "@material-ui/core/Fab";
import Button from "@material-ui/core/Button";
import Menu from "@material-ui/core/Menu";
import MenuItem from "@material-ui/core/MenuItem";
import { withStyles } from "@material-ui/core";
import compose from "recompose/compose";
import PropTypes from "prop-types";
import { connect } from "react-redux";
import { getPosts, savePost, deletePost } from "../Actions/PostActions";
import { getUser, logout } from "../Actions/UserActions";
import "../Layout/Navbar.css";
const styles = {
  root: {
    flexGrow: 1
  },
  side: {
    marginTop: "-20%",
    marginLeft: "50%"
  },
  button: {
    color: "black",
    fontSize: 18,
    alignItems: "center",
    height: 50,
    fontFamily: "'Montserrat', sans-serif",
    background: "transparent",
    margin: "5%"
  },
  me: {
    padding: "50%"
  },
  tit: {
    textDecoration: "none"
  },
  link: {
    color: "black",
    textDecoration: "none"
  },
  fab: {
    backgroundColor: "#6a3499",
    fontSize: 18,
    alignItems: "center",
    fontFamily: "'Montserrat', sans-serif"
  },
  card: {
    backgroundColor: "#e0e0e0"
  },
  menu: {
    backgroundColor: "#6a3499"
  }
};
class SignedInLinks extends Component {
  state = {
    anchorEl: null
  };

  handleClick = event => {
    this.setState({ anchorEl: event.currentTarget });
  };

  handleClose = () => {
    this.setState({ anchorEl: null });
  };
  render() {
    const { classes, post } = this.props;
    const { anchorEl } = this.state;
    return (
      <div>
        <div className="sticky-anchor" />
        <div className="sticky">
          <Button className="button1">Quiz</Button> <br />
          <Link to="/create" className={classes.link}>
            <Button className="button1">Kreiraj post</Button>
          </Link>
          <br />
          <Button
            className="button1"
            onClick={() => {
              this.props.logout();
            }}
          >
            Odlogiraj se
          </Button>{" "}
          <br />
        </div>
        <div className="sticky-small">
          <Fab
            aria-label="Add"
            className={classes.fab}
            aria-owns={anchorEl ? "simple-menu" : undefined}
            aria-haspopup="true"
            onClick={this.handleClick}
          >
            NN
          </Fab>
          <Menu
            id="simple-menu"
            anchorEl={anchorEl}
            open={Boolean(anchorEl)}
            onClose={this.handleClose}
            className={classes.me}
          />
          <div class="dropdown">
            <button class="dropbtn">Dropdown</button>
            <div class="dropdown-content">
              <a href="#">Link 1</a>
              <a href="#">Link 2</a>
              <a href="#">Link 3</a>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
SignedInLinks = connect(
  (state, ownProps) => ({
    posts: state.posts,
    user: state.user
  }),
  { savePost, getPosts, deletePost, getUser, logout }
)(SignedInLinks);
SignedInLinks.propTypes = {
  classes: PropTypes.object.isRequired,
  width: PropTypes.string.isRequired
};
export default compose(withStyles(styles))(SignedInLinks);
